import React, {useState, useEffect} from 'react'
import axios from 'axios'

function DataFetching() {

    const [item, setItem] = useState([]);
    const [id, setId] = useState(1)

    useEffect(() => {
        axios
        .get(`https://gist.githubusercontent.com/haikafaeq/07b106d20c9f5ce4daa6057a9858796a/raw/2f9e7c7d0f82700f239f55ea784be5ec0550219a/datafetching.json/${id}`)
        .then(res => {
            console.log(res)
            setItem(res.data)
        })
        .catch(err => {
            console.log(err)
        })

    }, [id])

    return (
        <div>
            <input type="text" value={id} onChange={e => setId(e.target.value)} />
            <div>{item.num}</div>
        </div>
    )
}

export default DataFetching
